export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},AF8jYcvlIs:{data:{id:480,attributes:{imdbId:"tt2406566",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjM5NDYzMzg5N15BMl5BanBnXkFtZTgwOTM2NDU1MjI@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"79%"},{Source:"Metacritic",Value:"63\u002F100"}],item_lang:{data:{id:1143,attributes:{title:h,plot:"The crown jewel of Her Majesty's Secret Intelligence Service, Agent Lorraine Broughton (Theron) is equal parts spycraft, sensuality and savagery, willing to deploy any of her skills to stay alive on her impossible mission. Sent alone into Berlin to deliver a priceless dossier out of the destabilized city, she partners with embedded station chief David Percival (James McAvoy) to navigate her way through the deadliest game of spies.",slug:"atomic-blonde"}}},books:{data:[{id:3721,attributes:{title:i,description:"November 1989. Communism is collapsing, and soon the Berlin Wall will come down with it. But before that happens there is one last bit of cloak & dagger to attend to. Two weeks ago, an undercover MI6 officer was killed in Berlin. He was carrying information from a source in the East—a list that allegedly contains the name of every espionage agent working in Berlin, on all sides. No list was found on his body. Now Lorraine Broughton, an experienced spy with no pre-existing ties to Berlin, has been sent into this powder keg of social unrest, counter-espionage, defections gone bad and secret assassinations to bring back the list and save the lives of the British agents whose identities reside on it.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OimXpwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2012-05-16",publisher:b,subtitle:e}},{id:3722,attributes:{title:h,description:"NOW A MAJOR MOTION PICTURE! November 1989. MI6 spy Lorraine Broughton was sent to Berlin to investigate the death of another agent, and the disappearance of a list revealing every spy working there. She found a powder keg of mistrust, assassinations and bad defections that ended with the murder of MI6's top officer, as the Berlin Wall was torn down. Now Lorraine has returned from the Cold War's coldest city, to tell her story. And nothing is what it seems.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-UQhMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:j,publisher:b,subtitle:i}},{id:3723,attributes:{title:k,description:l,thumbnail:m,authors:[a],firstBook:d,published:n,publisher:b,subtitle:e}},{id:3724,attributes:{title:k,description:l,thumbnail:m,authors:[a],firstBook:d,published:n,publisher:b,subtitle:e}},{id:3725,attributes:{title:"The Coldest Winter",description:"EIGHT YEARS BEFORE THE COLDEST CITY... BERLIN FROZE. Bestselling author Antony Johnston returns to The Coldest City for a tale even more complex, compelling, and cold than the first! After a string of botched assignments for MI6 in Berlin, David Perceval is being sent home. Even his final mission before leaving—the defection of a Soviet scientist—goes badly wrong, as the coldest winter for 30 years descends on Europe. With transport out of Berlin impossible, and the KGB searching everywhere for their lost scientist, Perceval must improvise a deadly game of cat and mouse through the frozen city to keep the Russians at bay, and deliver his own unique brand of revenge!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-NQZMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:j,publisher:b,subtitle:"Atomic Blonde Edition"}}]}}},meta:{}}},prerenderedAt:1682568393660}}("Antony Johnston","Oni Press","movie",null,"","series",1,"Atomic Blonde","The Coldest City","2017-05-23","The Coldest City: Atomic Blonde Edition","SOON TO BE A MAJOR MOTION PICTURE! November 1989. MI6 spy Lorraine Broughton was sent to Berlin to investigate the death of another agent, and the disappearance of a list revealing every spy working there. She found a powder keg of mistrust, assassinations and bad defections that ended with the murder of MI6's top officer, as the Berlin Wall was torn down. Now Lorraine has returned from the Cold War's coldest city, to tell her story. And nothing is what it seems.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9UILBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","1000-01-01"))